import classes from './WebPage3.module.css';

const WebPage3 = ({ video }) => {
  return (
    <div className={classes.mainContainer}>
      <div className={classes.innerContainer}>
        {video ? (
          <video controls src={video} className={classes.videoInput}>
            Your browser does not support the video tag.
          </video>
        ) : (
          <p>No video selected</p>  // Optional: Show a message when no video is selected
        )}
      </div>
    </div>
  );
};

export default WebPage3;
